import React, { Component } from "react";
import store from "../api";

export default class MainPage extends Component {
  getStoreData = async () => {
    storeData = store.get("/storeItems");
    console.log(storeData);
  };
  componentDidMount() {
    getStoreData();
  }
  render() {
    return (
      <div>
        <h1>Welcome to my site</h1>
      </div>
    );
  }
}
